import permanentData from "./lib/iana-permanent.js";
import provisionalData from "./lib/iana-provisional.js";
import historicalData from "./lib/iana-historical.js";
import unofficial from "./lib/unofficial.js";
const data = {
    permanent: permanentData,
    provisional: provisionalData,
    historical: historicalData,
    unofficial: [],
};
const allByName = {};
Object.keys(data).forEach(function (type) {
    data[type].forEach(function (schemeObj) {
        schemeObj.type = type;
        allByName[schemeObj.scheme] = schemeObj;
    });
});
data.unofficial = unofficial.filter(function (item) {
    return !allByName[item.scheme];
});
data.unofficial.forEach(function (schemeObj) {
    schemeObj.type = "unofficial";
    allByName[schemeObj.scheme] = schemeObj;
});
data.allByName = allByName;
export default data;
